@Леонид Чухров А учеников автошколы надо обязать участвовать в гонках Формула-1,они же будущие водители,вот пусть и мчатся со скоростью 400 км/ч,толком не освоив управление автомобилем!
Сейчас,слава богу не 41 г.(хотя очень напоминает,та же растерянность и паника,полное отсутствие координации действий,беспомощность власти,...)Зачем кидаться грудью на амбразуру?Тем более что вреда от этого будет больше чем пользы?!Вы бы хотели что бы вас лечил не хороший опытный врач,а студент-недоучка,который в силу неопытности перезаражает людей больше чем вылечит?
Запретить всем чиновникам лечиться за границей!Пусть их студенты-практиканты лечат!

