@Pastorov Illa и еще парочку писак за деньги ! Вас всех ботов послать в ковидитарии без средств защиты! А не студентов медиков! Хочу за всех за них заступиться. В мед.ин поступить трудно, нужны знания, учиться тяжело, да и учатся сейчас они долго. 9 лет в сумме. 
А вы , научились по клавишам стучать . Все ваши знания??? Не давайте советы космической глупости, когда не знаете, как и что работает в медицине, в системе образования медицины. Одним словом , подлецы Вы.
Даже за деньги такое писать аморально!

@Илья 0479 студентов не учат за счёт бюджета у нас в стране? )) А если учат то деньги нужно отработать. А то не хотят идти работать, они такую профессию выбрали.
И не надо мне предлагать отработать, я инженер-строитель. Не подхожу. 
Совсем ты глупый и скучный.
